                    </a></div> <div class="a-lg:hidden"><button type="button" class="base-button base-button_theme_blue base-button_view_link"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="36" height="10" xmlns="http://www.w3.org/2000/svg" class="fill-current text-blue-700 icon sprite-icons svg-icon svg-icon_burger"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-burger" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-burger"></use></svg></div> <!----> <!----></div></div></button></div></div></div></div></div> <div class="flex-1"><div class="relative"><div class="absolute top-0 right-full max-w-[337px] max-h-[210px] w-full h-full translate-x-24 -translate-y-16 pointer-events-none lg:translate-x-12"><div class="absolute inset-0 clip-path-red bg-red-500 rotate-[38deg]"><div class="absolute inset-0 bg-noise opacity-60"></div></div></div> <div class="absolute top-0 left-full max-w-[295px] max-h-[316px] w-full h-full -translate-x-34 pointer-events-none lg:-translate-x-16 md:-top-6 md:translate-x-0 md:max-w-[300px] md:max-h-[320px]"><div class="absolute inset-0 clip-path-purple bg-purple-500 rotate-[49deg]"><div class="absolute inset-0 bg-noise opacity-60"></div></div></div> <div class="container pt-14 pb-20 lg:pb-10"><div><a href="../index.html" class="inline-block fill-current transition-fast cursor-pointer mb-14 hover:text-blue-700 nuxt-link-active"><svg width="20" height="12" xmlns="http://www.w3.org/2000/svg" class="transform scale-reverse icon sprite-icons svg-icon svg-icon_arrow-right"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-arrow-right" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-arrow-right"></use></svg></a> <main><div class="grid grid-cols-12"><div class="col-span-8 lg:col-span-12 mb-14 lg:mb-10"><h1 class="title-h2">Что такое миссия бренда? От теории к практике</h1></div> <div class="col-span-12 mb-14 lg:mb-10"><img src="../../_image/i/rs%EF%B9%95fit%EF%B9%951320%EF%B9%95700/format%EF%B9%95jpg/preset%EF%B9%95placeholder/2027b9d9148bc0e4c97a98bc86a830e8.jpg" data-src="../../_image/i/rs%EF%B9%95fit%EF%B9%951320%EF%B9%95700/format%EF%B9%95jpg/2027b9d9148bc0e4c97a98bc86a830e8.jpg" class="object-cover -lazyload -lazyload-preloader"></div></div> <div class="grid grid-cols-12"><div class="col-span-8 lg:col-span-12  typography typography-old text-lg lg:text-base"><p>Миссия&nbsp;&mdash; основная причина создания бренда, выраженная в&nbsp;одном либо в&nbsp;нескольких предложениях. Как правило, она отражает не&nbsp;финансовые планы, а&nbsp;смысл бытия компании: какой след бренд стремится оставить в&nbsp;истории, какую пользу приносит потребителям, чего хочет добиться. Проще говоря, миссия рассказывает для чего в&nbsp;глобальном смысле была создана организация.</p>
<blockquote>Миссия&nbsp;&mdash; это первопричина. Всем&nbsp;ли она нужна? Конечно, нет. Многие компании живут по&nbsp;принципу Портоса, говорившего: &laquo;Я&nbsp;дерусь... просто потому что дерусь&raquo;. Вот только нельзя забывать, что любимцем читателей стал Д&rsquo;Артаньян, действовавший ради любви, чести, долга и&nbsp;сформулировавший всем известный девиз мушкетеров &laquo;Один за&nbsp;всех и&nbsp;все за&nbsp;одного&raquo;.</blockquote>
<h3>Миссия бренда&nbsp;&mdash; зачем и&nbsp;в&nbsp;каких случаях?</h3>
<p>Существует три основные причины для разработки миссии: а) для взаимодействия с&nbsp;потенциальными и&nbsp;состоявшимися покупателями;&nbsp;б) для мотивации коллектива; в) потому что у&nbsp;всех есть. Рассмотрим на&nbsp;примерах, в&nbsp;чем различие между этими подходами.</p>
<p><strong>1. Миссия как составляющая коммуникационной стратегии</strong></p>
<p>В&nbsp;данном случае миссия является кратким объяснением: &laquo;Для чего мы&nbsp;созданы?&raquo;. Она помогает компании стать понятной и&nbsp;более привлекательной для потенциальных покупателей, доносит до&nbsp;них глобальные задачи, в&nbsp;решении которых помогает бренд.</p>
<p>Пример. Миссия сети супермаркетов &laquo;Лента&raquo;: Мы&nbsp;работаем для того, чтобы люди в&nbsp;России жили лучше и&nbsp;богаче, сохраняя свои деньги каждый день.</p>
<p><strong>2. Миссия как девиз, мотивирующий персонал компании</strong></p>
<p>Это расширенный вариант миссии, который предназначен для внутреннего использования. Она помогает персоналу понять смысл ежедневной деятельности и&nbsp;формирует команду. По&nbsp;сути, это путеводная звезда, указывающая направление движения и&nbsp;мотивирующая персонал фирмы на&nbsp;продолжение пути.</p>
<p>Пример. Миссия сети пиццерий &laquo;Додо Пицца&raquo;: Мы&nbsp;создаем вкусную еду и&nbsp;искренний сервис, чтобы подарить людям больше моментов радости.</p>
<p><strong>3. Миссия как ответ на&nbsp;просьбу руководства</strong></p>
<p>Миссия нужна в&nbsp;том случае, когда у&nbsp;фирмы есть искренний повод для существования, кроме зарабатывания денег. Компании, работающие в&nbsp;формате &laquo;купи-продай&raquo; обычно не&nbsp;нуждаются в&nbsp;миссии. Но&nbsp;часто заказывают ее&nbsp;разработку, мотивируя это желание словами &laquo;у&nbsp;всех есть, нам тоже нужно&raquo;. Как правило, результатом становится невразумительный текст, который спрятан в&nbsp;глубинах корпоративного сайта и&nbsp;никому не&nbsp;интересен. Приведем пример миссии из&nbsp;категории &laquo;потому что у&nbsp;всех есть&raquo;.</p>
<p>Миссия гипотетической фирмы &laquo;Название&raquo;: Занять ведущее место на&nbsp;рынке адронных коллайдеров за&nbsp;счет постоянного улучшения сервиса и&nbsp;качества продукции.</p>
<p><img src="data:image/png;base64,"></p>
<h3>Миссия, цель, ценности, стратегия, слоган, легенда, УТП&nbsp;&mdash; а&nbsp;есть&nbsp;ли разница?</h3>
<p>Единого определения миссии не&nbsp;существует даже в&nbsp;профессиональных кругах. И&nbsp;возможно именно в&nbsp;этом причина некоторой путаницы, которая возникает при общении владельцев бизнеса и&nbsp;сотрудников брендинговых агентств. Прежде чем перейти к&nbsp;практике, предлагаем рассмотреть основные понятия. Это поможет избежать недоразумений в&nbsp;будущем.</p>
<ul>
<li>Миссия&nbsp;&mdash; объяснение &laquo;Для чего мы&nbsp;существуем?&raquo;. Это философия, построенная на&nbsp;ценностях бренда. В&nbsp;отличие от&nbsp;целей ее&nbsp;нельзя достичь. Но&nbsp;ей&nbsp;можно (и&nbsp;нужно) следовать. Например, миссия бренда &laquo;Спортмастер&raquo; состоит в&nbsp;том, чтобы делать спорт доступным.</li>
<li>Цель&nbsp;&mdash; результат. Возможно, далекий, но&nbsp;достижимый. В&nbsp;идеале цель выражается в&nbsp;конкретных показателях, которые должны быть реализованы к&nbsp;тому или иному сроку. Например, &laquo;увеличить производство молока на&nbsp;23% к&nbsp;1&nbsp;октября 2021&nbsp;года&raquo; либо &laquo;вывести на&nbsp;рынок новый вид плавленого сыра в&nbsp;первом квартале 2022&nbsp;года&raquo;.</li>
<li>Ценности&nbsp;&mdash; это свод законов, согласно которым существует компания. Своего рода морально-этический кодекс, чьи положения обязательны для выполнения всеми сотрудниками от&nbsp;уборщицы до&nbsp;директора. Ценности компании рассказывают &laquo;Что такое хорошо и&nbsp;что такое плохо?&raquo;.</li>
<li>Стратегия&nbsp;&mdash; ответ на&nbsp;вопрос &laquo;Как мы&nbsp;будет следовать миссии и&nbsp;достигать цель?&raquo;. Это путь, который необходимо пройти для достижения того или иного результата. Различают стратегию позиционирования, коммуникаций, продвижения, а&nbsp;также комплексную бренд-стратегию.</li>
<li>Слоган&nbsp;&mdash; короткое предложение, которое основывается на&nbsp;миссии компании, но&nbsp;не&nbsp;повторяет&nbsp;ее. Хороший слоган&nbsp;&mdash; краткий, емкий, эмоциональный. Он&nbsp;буквально въедается в&nbsp;мозг и&nbsp;запоминается если не&nbsp;навсегда, но&nbsp;очень надолго. Часто в&nbsp;качестве слогана используется призыв или мотивирующая фраза.</li>
<li>Легенда бренда&nbsp;&mdash; интересная и&nbsp;запоминающаяся история, которая делает компанию более живой и&nbsp;понятной для целевой аудитории, представляет ее&nbsp;в&nbsp;выгодном свете. В&nbsp;брендинге существует немало примеров тому, как удачная легенда бренда помогла улучшить репутацию и&nbsp;привлечь потребителей.</li>
<li>УТП&nbsp;&mdash; уникальное торговое предложение. Главное отличие, выделяющее компанию или ее&nbsp;продукт на&nbsp;фоне конкурентов. Это ответ на&nbsp;вопрос о&nbsp;том, почему покупатель должен выбрать именно этот товар, а&nbsp;не&nbsp;продукт другой марки.</li>
</ul>
<p>Итак, с&nbsp;основными понятиями разобрались. Переходим от&nbsp;теории к&nbsp;практике и&nbsp;предлагаем пошаговую инструкцию по&nbsp;созданию миссии бренда.</p>
<h3>Этапы разработки миссии для бренда</h3>
<p><strong>Подготовительный этап или шаг №&nbsp;0</strong></p>
<p>Еще до&nbsp;старта нужно определиться, в&nbsp;каком виде миссия будет создаваться. Существует немало мнений о&nbsp;том, что она должна включать в&nbsp;себя. Но&nbsp;наибольшее распространение получил четырехаспектный подход. Он&nbsp;предлагает учитывать:</p>
<ul>
<li>социальный&nbsp;&mdash; базируется на&nbsp;философии и&nbsp;культуре бренда, а&nbsp;также на&nbsp;интересах целевой аудитории;</li>
<li>рыночный&nbsp;&mdash; учитывает особенности продукции, стратегию развития фирмы, цели организации и&nbsp;т.д.;</li>
<li>частный&nbsp;&mdash; основывается на&nbsp;бизнес-успехах в&nbsp;плане личных интересов руководства или собственника компании;</li>
<li>качественный&nbsp;&mdash; в&nbsp;данном случае на&nbsp;первый план выходит намерение изменить условия и&nbsp;качество жизни&nbsp;ЦА или общества.</li>
</ul>
<p>Если владелец бизнеса решил заказать разработку в&nbsp;брендинговом агентстве, то&nbsp;проблема совмещения всех аспектов в&nbsp;одной миссии становится их&nbsp;головной болью и&nbsp;не&nbsp;должна волновать клиента. Другое дело&nbsp;&mdash; самостоятельное создание. Не&nbsp;обладая специальными знаниями и&nbsp;практическим опытом, решить эту задачу почти невозможно. В&nbsp;этом случае стоит сосредоточить усилия на&nbsp;качественном аспекте, поскольку он&nbsp;импонирует потенциальным покупателям, которые видят в&nbsp;нем &laquo;заботу&raquo; со&nbsp;стороны производителя.</p>
<blockquote>Обратите внимание! Этой стратегии следуют не&nbsp;только небольшие компании, но&nbsp;и&nbsp;крупные бренды. Выше мы&nbsp;уже упоминали сеть супермаркетов &laquo;Лента&raquo;, миссия которой является ярким образцом качественного подхода. Но&nbsp;можно привести и&nbsp;другие примеры. Допустим, Tele2. Их&nbsp;миссия звучит следующим образом: &laquo;Мы&nbsp;создаем альтернативу сложившимся рыночным практикам. Мы&nbsp;несем новое качество жизни потребителям мобильных услуг: честные, прозрачные, выгодные предложения, высококачественные партнерские программы и&nbsp;услуги&raquo;.</blockquote>
<p><img src="data:image/png;base64,"></p>
<p><strong>Первый этап разработки миссии для бренда&nbsp;&mdash; создаем скелет</strong></p>
<p>Честно говоря, слово &laquo;разработка&raquo; не&nbsp;совсем применимо, когда речь идет о&nbsp;миссии. Тут уместнее &laquo;осознание&raquo; или &laquo;формулирование&raquo;. Чтобы понять, в&nbsp;чем миссия фирмы и&nbsp;четко изложить&nbsp;ее, необходимо ответить на&nbsp;ряд вопросов. Причем они будут разными для короткой (клиентской) и&nbsp;расширенной (корпоративной) версии.</p>
<table style="width: 100%; border-collapse: collapse; border-style: none;" border="1">
<tbody>
<tr>
<td style="width: 50%;"><strong>Вопросы для короткой миссии</strong></td>
<td style="width: 50%; border-style: none;"><strong>Вопросы для расширенной миссии</strong></td>
</tr>
<tr>
<td style="width: 50%;">
<ul>
<li>Что мы&nbsp;производим?</li>
<li>Для чего мы&nbsp;это производим?</li>
<li>Кто наши покупатели?</li>
<li>Для чего наш товар/услуга покупателям?<br>Какие &laquo;боли&raquo; ЦА&nbsp;мы&nbsp;закрываем?</li>
<li>Что сделает нас успешными через 5&nbsp;лет?</li>
<li>Каким путем мы&nbsp;придем к&nbsp;успеху?</li>
<li>Чем мы&nbsp;помогаем обществу и&nbsp;миру?</li>
</ul>
</td>
<td style="width: 50%; border-style: none;">
<ul>
<li>Какова цель нашей работы?</li>
<li>В&nbsp;какой области мы&nbsp;работаем?</li>
<li>Какова философия нашего бренда?</li>
<li>Какие методы ведут нас к&nbsp;цели?</li>
<li>Как мы&nbsp;взаимодействуем с&nbsp;ЦА?</li>
<li>Что мы&nbsp;стремимся показать миру?</li>
<li>На&nbsp;какой результат мы&nbsp;рассчитываем?</li>
<li>Каким путем мы&nbsp;сможем это сделать?</li>
</ul>
</td>
</tr>
</tbody>
</table>
<p>Ваша задача состоит в&nbsp;том, чтобы максимально расширить каждый ответ. То&nbsp;есть рассказать &laquo;что мы&nbsp;делаем?&raquo; недостаточно. Также нужно сформулировать &laquo;когда, зачем, какими инструментами?&raquo;. Чем больше вопросов и&nbsp;чем подробнее ответы, тем лучше. Только так можно понять глубинный смысл существования бренда.</p>
<p><img src="data:image/png;base64,"></p>
<p><strong>Второй этап разработки миссии для бренда&nbsp;&mdash; отсекаем все лишнее</strong></p>
<blockquote>Однажды Микеланджело Буанаротти спросили: &laquo;Как вам удается создавать такие великолепные статуи?&raquo;. На&nbsp;что великий итальянский скульптор ответил: &laquo;Я&nbsp;беру глыбу мрамора и&nbsp;отсекаю от&nbsp;нее все лишнее&raquo;</blockquote>
<p>Так вот, ваша задача на&nbsp;этом этапе отсечь все лишнее. Оптимальная длина короткой (клиентской) миссии&nbsp;&mdash; 1-3&nbsp;предложения. Расширенная миссия, предназначенная для внутрикорпоративного использования может быть немного длиннее. Но&nbsp;ключевое слово здесь &laquo;немного&raquo;&nbsp;&mdash; 5-7 предложений более чем достаточно.</p>
<p>Внимательно изучите ответы, составляющие скелет миссии. Выделите главную мысль и&nbsp;избавьтесь от&nbsp;всего лишнего и&nbsp;второстепенного. И&nbsp;да! Будьте готовы к&nbsp;тому, что это очень непросто. Именно сокращение ненужного в&nbsp;99,99% случаев становится наиболее сложной задачей.</p>
<p>Несколько примеров миссии бренда:</p>
<ul>
<li>&laquo;Убрать все барьеры между покупателем и&nbsp;продавцом&raquo;&nbsp;&mdash; Alibaba;</li>
<li>&laquo;Изменить к&nbsp;лучшему повседневную жизнь простых людей&raquo;&nbsp;&mdash; IKEA;</li>
<li>&laquo;Чтобы чувствовать себя хорошо&raquo;&nbsp;&mdash; Valio.</li>
</ul>
<p><img src="data:image/png;base64,"></p>
<p><strong>Третий этап разработки миссии для бренда&nbsp;&mdash; проверяем</strong></p>
<p>Миссия, эффективно работающая на&nbsp;благо компании, всегда понятна. Ни&nbsp;клиенты, ни&nbsp;персонал не&nbsp;должны отгадывать загадки и&nbsp;думать, что вы&nbsp;хотели сказать. Поэтому на&nbsp;предыдущем этапе лучше сформулировать несколько заготовок. Проверив их&nbsp;все, вы&nbsp;сможете выбрать&nbsp;ту, которая наиболее полно соответствует шести параметрам:</p>
<ul>
<li>Удовлетворенность ЦА. Каждый покупатель хочет чувствовать заботу. Миссия бренда должна объяснить, как и&nbsp;почему его жизнь изменится к&nbsp;лучшему после приобретения продукта.</li>
<li>Оригинальность. Каждый бренд уникален и&nbsp;неповторим, поэтому не&nbsp;имеет смысла копировать или переиначивать чужую идею. Постарайтесь вложить в&nbsp;миссию ключевое отличие вашей компании от&nbsp;конкурентов.</li>
<li>Ценности. Чем живет бренд и&nbsp;что он&nbsp;транслирует своей целевой аудитории&nbsp;&mdash; эта информация очень важна. Убедитесь в&nbsp;том, что она нашла свое отражение в&nbsp;миссии компании.</li>
<li>Честность. Не&nbsp;стоит говорить о&nbsp;лучшем качестве, если ваше главное преимущество&nbsp;&mdash; низкие цены. Вам все равно не&nbsp;поверят. В&nbsp;самом хорошем случае миссия просто не&nbsp;сработает. В&nbsp;плохом&nbsp;&mdash; сыграет на&nbsp;руку конкурентам.</li>
<li>Легкость, прозрачность и&nbsp;ясность. Никаких двойных толкований и&nbsp;скрытых смыслов! Миссия обязана быть абсолютно прозрачна и&nbsp;доступна всем&nbsp;&mdash; от&nbsp;школьника до&nbsp;его прабабушки.</li>
<li>Запоминаемость. Миссия&nbsp;&mdash; это не&nbsp;слоган. Но&nbsp;тем не&nbsp;менее целевая аудитория должна знать и&nbsp;помнить&nbsp;ее. Иначе, какой смысл в&nbsp;создании? Убедитесь, что она не&nbsp;содержит сложных формулировок и&nbsp;легко запоминается.</li>
</ul>
<p>Стоит отметить, что разработка миссии бренда, которая&nbsp;бы отвечала всем перечисленным требованиям,&nbsp;&mdash; сложная задача. Сформулировать ее&nbsp;в&nbsp;перерыве между обедом и&nbsp;совещанием не&nbsp;получится. Потребуется время и&nbsp;чаще всего немало. Но&nbsp;если вам это удастся, то&nbsp;можно с&nbsp;уверенностью говорить об&nbsp;эффективности миссии.</p>
<p><strong>Подведем итог</strong></p>
<p>Миссия бренда&nbsp;&mdash; нематериальный актив компании и&nbsp;инструмент, который помогает добиться поставленных целей. В&nbsp;будущем формулировка миссии может изменяться и&nbsp;корректироваться, но&nbsp;ключевая идея, объединяющая бренд, сотрудников и&nbsp;покупателей под одним знаменем, должна оставаться прежней.</p>
<p>Если вы&nbsp;не&nbsp;уверены в&nbsp;том, что самостоятельно справитесь с&nbsp;созданием миссии, доверьте эту задачу специалистам. К&nbsp;примеру, вы&nbsp;можете воспользоваться помощью первого брендингового онлайн-сервиса Brand hub.</p>
<blockquote>Наша миссия&nbsp;&mdash; сделать услуги брендинга доступными и&nbsp;понятными для начинающих предпринимателей, малого и&nbsp;среднего бизнеса. Мы&nbsp;автоматизировали множество агентских процессов, чтобы создание бренда было для вас простым и&nbsp;эффективным.</blockquote>
<p>Остались вопросы? Свяжитесь с&nbsp;нами через форму на&nbsp;сайте или позвоните: +7 (495) 118-33-14.</p>
