ton_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_telegram"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram"></use></svg></div> <!----> <!----></div></div></button></div> <div class="absolute bottom-0 left-0 z-30"><button type="button" class="shadow-inner-white base-button base-button_theme_green base-button_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_whatsapp"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp"></use></svg></div> <!----> <!----></div></div></button></div></div></div></div></div></div></div><script>window.__NUXT__=(function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r){r.id=77;r.slug=a;r.title=g;r.url=a;r.protocol=c;r.type={code:h,description:"Роут"};r.createdAt="2021-09-30T19:13:44+03:00";r.updatedAt="2021-09-30T19:39:09+03:00";r.meta={title:a,description:a,keywords:a};r.content={id:346,text:a,blocks:[]};r.children=[];return {layout:"default",data:[{post:{title:"Что такое миссия бренда? От теории к практике",slug:"chto-takoe-missiya-brenda-ot-teorii-k-praktike",shortDescription:"Миссия&nbsp;&mdash; основная причина создания бренда, выраженная в&nbsp;одном либо в&nbsp;нескольких предложениях. Как правило, она отражает не&nbsp;финансовые планы, а&nbsp;смысл бытия компании: какой след бренд стремится оставить в&nbsp;истории, какую пользу приносит потребителям, чего хочет добиться. Проще говоря, миссия рассказывает для чего в&nbsp;глобальном смысле была создана организация.",createdAt:"2021-11-16T10:58:15+03:00",isImported:f,image:{file:{url:"\u002Fuploads\u002Ffile\u002F2\u002F0\u002F2\u002F2027b9d9148bc0e4c97a98bc86a830e8.png",name:"2027b9d9148bc0e4c97a98bc86a830e8.png",originalName:"avatar.png",extension:"png",size:"726.1 Кб"}},content:{id:437,text:"\u003Cp\u003EМиссия&nbsp;&mdash; основная причина создания бренда, выраженная в&nbsp;одном либо в&nbsp;нескольких предложениях. Как правило, она отражает не&nbsp;финансовые планы, а&nbsp;смысл бытия компании: какой след бренд стремится оставить в&nbsp;истории, какую пользу приносит потребителям, чего хочет добиться. Проще говоря, миссия рассказывает для чего в&nbsp;глобальном смысле была создана организация.\u003C\u002Fp\u003E\r\n\u003Cblockquote\u003EМиссия&nbsp;&mdash; это первопричина. Всем&nbsp;ли она нужна? Конечно, нет. Многие компании живут по&nbsp;принципу Портоса, говорившего: &laquo;Я&nbsp;дерусь... просто потому что дерусь&raquo;. Вот только нельзя забывать, что любимцем читателей стал Д&rsquo;Артаньян, действовавший ради любви, чести, долга и&nbsp;сформулировавший всем известный девиз мушкетеров &laquo;Один за&nbsp;всех и&nbsp;все за&nbsp;одного&raquo;.\u003C\u002Fblockquote\u003E\r\n\u003Ch3\u003EМиссия бренда&nbsp;&mdash; зачем и&nbsp;в&nbsp;каких случаях?\u003C\u002Fh3\u003E\r\n\u003Cp\u003EСуществует три основные причины для разработки миссии: а) для взаимодействия с&nbsp;потенциальными и&nbsp;состоявшимися покупателями;&nbsp;б) для мотивации коллектива; в) потому что у&nbsp;всех есть. Рассмотрим на&nbsp;примерах, в&nbsp;чем различие между этими подходами.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003E1. Миссия как составляющая коммуникационной стратегии\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EВ&nbsp;данном случае миссия является кратким объяснением: &laquo;Для чего мы&nbsp;созданы?&raquo;. Она помогает компании стать понятной и&nbsp;более привлекательной для потенциальных покупателей, доносит до&nbsp;них глобальные задачи, в&nbsp;решении которых помогает бренд.\u003C\u002Fp\u003E\r\n\u003Cp\u003EПример. Миссия сети супермаркетов &laquo;Лента&raquo;: Мы&nbsp;работаем для того, чтобы люди в&nbsp;России жили лучше и&nbsp;богаче, сохраняя свои деньги каждый день.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003E2. Миссия как девиз, мотивирующий персонал компании\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EЭто расширенный вариант миссии, который предназначен для внутреннего использования. Она помогает персоналу понять смысл ежедневной деятельности и&nbsp;формирует команду. По&nbsp;сути, это путеводная звезда, указывающая направление движения и&nbsp;мотивирующая персонал фирмы на&nbsp;продолжение пути.\u003C\u002Fp\u003E\r\n\u003Cp\u003EПример. Миссия сети пиццерий &laquo;Додо Пицца&raquo;: Мы&nbsp;создаем вкусную еду и&nbsp;искренний сервис, чтобы подарить людям больше моментов радости.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003E3. Миссия как ответ на&nbsp;просьбу руководства\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EМиссия нужна в&nbsp;том случае, когда у&nbsp;фирмы есть искренний повод для существования, кроме зарабатывания денег. Компании, работающие в&nbsp;формате &laquo;купи-продай&raquo; обычно не&nbsp;нуждаются в&nbsp;миссии. Но&nbsp;часто заказывают ее&nbsp;разработку, мотивируя это желание словами &laquo;у&nbsp;всех есть, нам тоже нужно&raquo;. Как правило, результатом становится невразумительный текст, который спрятан в&nbsp;глубинах корпоративного сайта и&nbsp;никому не&nbsp;интересен. Приведем пример миссии из&nbsp;категории &laquo;потому что у&nbsp;всех есть&raquo;.\u003C\u002Fp\u003E\r\n\u003Cp\u003EМиссия гипотетической фирмы &laquo;Название&raquo;: Занять ведущее место на&nbsp;рынке адронных коллайдеров за&nbsp;счет постоянного улучшения сервиса и&nbsp;качества продукции.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0K