lF1vePZHu5lCuwvMjD1baN0\u002FwkiLp9nPoQM6icJIomCaOYYZX58x60boIo9equ4cMCK0kzP1Ysu7JztZ1XbA2ehRXPraqpF+SYKrp0zDiLMFZ2dXuxpjbD3I6Xq8MxSe31vb8qdeuVeHWYqroyE162hqHphvO2bX7G3vMuW89PjQ6P\u002F\u002FUXfPO\u002FfE8AAAAA+A0GgQUAAADwK+TNr\u002Fsdn7asdzeOJpPPaNfLT8mz9OVpkrzKzNJhjII3KRVivpVkkVc4heD5Wv0+Y0r\u002F+FI1Vb8PaFdVVJbl7quyLN3PElTrYfBQdv2uryzPfAJh23Qxz2p4oZJr8IqtbJ9TJSnVe3mXWg5TF1txRmES9gfX49chL96VDt0vZVXxnjQt3j05qt792f\u002FnO34pAAAAAHwcgsACAAAA+HXyrV\u002F02x7qdt0DaZXfyofhd2QhGXWh\u002F+QszW51ff9JydA\u002FYEJpMPHkSir1eqxYMSUZtVZrYFGGNJWMSr2lsN7s\u002FF9q\u002FX7Snx5XvlarLK4syiy1MOq1ZalweKVmqUXQE9ifN\u002Fn1vL3p3UnfPd1n2dIee7JPsh8f7bbr1\u002F2zn346AAAAAHwCgcACAAAA+Bjxjj\u002FyuY8NXXfLfjxq6u5o2NWTvutC0+zyTvVXabhfE\u002F+SLEnyNE12TZM0XTfUbRgWXTIUo\u002FT5k6rq0r7tijIfivGozcrialLNPrg5v3v9uW\\u002FAdoUqd6aJE0oAAAAAElFTkSuQmCC\"\u003E\u003C\u002Fp\u003E\r\n\u003Ch3\u003EМиссия, цель, ценности, стратегия, слоган, легенда, УТП&nbsp;&mdash; а&nbsp;есть&nbsp;ли разница?\u003C\u002Fh3\u003E\r\n\u003Cp\u003EЕдиного определения миссии не&nbsp;существует даже в&nbsp;профессиональных кругах. И&nbsp;возможно именно в&nbsp;этом причина некоторой путаницы, которая возникает при общении владельцев бизнеса и&nbsp;сотрудников брендинговых агентств. Прежде чем перейти к&nbsp;практике, предлагаем рассмотреть основные понятия. Это поможет избежать недоразумений в&nbsp;будущем.\u003C\u002Fp\u003E\r\n\u003Cul\u003E\r\n\u003Cli\u003EМиссия&nbsp;&mdash; объяснение &laquo;Для чего мы&nbsp;существуем?&raquo;. Это философия, построенная на&nbsp;ценностях бренда. В&nbsp;отличие от&nbsp;целей ее&nbsp;нельзя достичь. Но&nbsp;ей&nbsp;можно (и&nbsp;нужно) следовать. Например, миссия бренда &laquo;Спортмастер&raquo; состоит в&nbsp;том, чтобы делать спорт доступным.\u003C\u002Fli\u003E\r\n\u003Cli\u003EЦель&nbsp;&mdash; результат. Возможно, далекий, но&nbsp;достижимый. В&nbsp;идеале цель выражается в&nbsp;конкретных показателях, которые должны быть реализованы к&nbsp;тому или иному сроку. Например, &laquo;увеличить производство молока на&nbsp;23% к&nbsp;1&nbsp;октября 2021&nbsp;года&raquo; либо &laquo;вывести на&nbsp;рынок новый вид плавленого сыра в&nbsp;первом квартале 2022&nbsp;года&raquo;.\u003C\u002Fli\u003E\r\n\u003Cli\u003EЦенности&nbsp;&mdash; это свод законов, согласно которым существует компания. Своего рода морально-этический кодекс, чьи положения обязательны для выполнения всеми сотрудниками от&nbsp;уборщицы до&nbsp;директора. Ценности компании рассказывают &laquo;Что такое хорошо и&nbsp;что такое плохо?&raquo;.\u003C\u002Fli\u003E\r\n\u003Cli\u003EСтратегия&nbsp;&mdash; ответ на&nbsp;вопрос &laquo;Как мы&nbsp;будет следовать миссии и&nbsp;достигать цель?&raquo;. Это путь, который необходимо пройти для достижения того или иного результата. Различают стратегию позиционирования, коммуникаций, продвижения, а&nbsp;также комплексную бренд-стратегию.\u003C\u002Fli\u003E\r\n\u003Cli\u003EСлоган&nbsp;&mdash; короткое предложение, которое основывается на&nbsp;миссии компании, но&nbsp;не&nbsp;повторяет&nbsp;ее. Хороший слоган&nbsp;&mdash; краткий, емкий, эмоциональный. Он&nbsp;буквально въедается в&nbsp;мозг и&nbsp;запоминается если не&nbsp;навсегда, но&nbsp;очень надолго. Часто в&nbsp;качестве слогана используется призыв или мотивирующая фраза.\u003C\u002Fli\u003E\r\n\u003Cli\u003EЛегенда бренда&nbsp;&mdash; интересная и&nbsp;запоминающаяся история, которая делает компанию более живой и&nbsp;понятной для целевой аудитории, представляет ее&nbsp;в&nbsp;выгодном свете. В&nbsp;брендинге существует немало примеров тому, как удачная легенда бренда помогла улучшить репутацию и&nbsp;привлечь потребителей.\u003C\u002Fli\u003E\r\n\u003Cli\u003EУТП&nbsp;&mdash; уникальное торговое предложение. Главное отличие, выделяющее компанию или ее&nbsp;продукт на&nbsp;фоне конкурентов. Это ответ на&nbsp;вопрос о&nbsp;том, почему покупатель должен выбрать именно этот товар, а&nbsp;не&nbsp;продукт другой марки.\u003C\u002Fli\u003E\r\n\u003C\u002Ful\u003E\r\n\u003Cp\u003EИтак, с&nbsp;основными понятиями разобрались. Переходим от&nbsp;теории к&nbsp;практике и&nbsp;предлагаем пошаговую инструкцию по&nbsp;созданию миссии бренда.\u003C\u002Fp\u003E\r\n\u003Ch3\u003EЭтапы разработки миссии для бренда\u003C\u002Fh3\u003E\r\n\u003Cp\u003E\u003Cstrong\u003EПодготовительный этап или шаг №&nbsp;0\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EЕще до&nbsp;старта нужно определиться, в&nbsp;каком виде миссия будет создаваться. Существует немало мнений о&nbsp;том, что она должна включать в&nbsp;себя. Но&nbsp;наибольшее распространение получил четырехаспектный подход. Он&nbsp;предлагает учитывать:\u003C\u002Fp\u003E\r\n\u003Cul\u003E\r\n\u003Cli\u003Eсоциальный&nbsp;&mdash; базируется на&nbsp;философии и&nbsp;культуре бренда, а&nbsp;также на&nbsp;интересах целевой аудитории;\u003C\u002Fli\u003E\r\n\u003Cli\u003Eрыночный&nbsp;&mdash; учитывает особенности продукции, стратегию развития фирмы, цели организации и&nbsp;т.д.;\u003C\u002Fli\u003E\r\n\u003Cli\u003Eчастный&nbsp;&mdash; основывается на&nbsp;бизнес-успехах в&nbsp;плане личных интересов руководства или собственника компании;\u003C\u002Fli\u003E\r\n\u003Cli\u003Eкачественный&nbsp;&mdash; в&nbsp;данном случае на&nbsp;первый план выходит намерение изменить условия и&nbsp;качество жизни&nbsp;ЦА или общества.\u003C\u002Fli\u003E\r\n\u003C\u002Ful\u003E\r\n\u003Cp\u003EЕсли владелец бизнеса решил заказать разработку в&nbsp;брендинговом агентстве, то&nbsp;проблема совмещения всех аспектов в&nbsp;одной миссии становится их&nbsp;головной болью и&nbsp;не&nbsp;должна волновать клиента. Другое дело&nbsp;&mdash; самостоятельное создание. Не&nbsp;обладая специальными знаниями и&nbsp;практическим опытом, решить эту задачу почти невозможно. В&nbsp;этом случае стоит сосредоточить усилия на&nbsp;качественном аспекте, поскольку он&nbsp;импонирует потенциальным покупателям, которые видят в&nbsp;нем &laquo;заботу&raquo; со&nbsp;стороны производителя.\u003C\u002Fp\u003E\r\n\u003Cblockquote\u003EОбратите внимание! Этой стратегии следуют не&nbsp;только небольшие компании, но&nbsp;и&nbsp;крупные бренды. Выше мы&nbsp;уже упоминали сеть супермаркетов &laquo;Лента&raquo;, миссия которой является ярким образцом качественного подхода. Но&nbsp;можно привести и&nbsp;другие примеры. Допустим, Tele2. Их&nbsp;миссия звучит следующим образом: &laquo;Мы&nbsp;создаем альтернативу сложившимся рыночным практикам. Мы&nbsp;несем новое качество жизни потребителям мобильных услуг: честные, прозрачные, выгодные предложения, высококачественные партнерские программы и&nbsp;услуги&raquo;.\u003C\u002Fblockquote\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAASB1SURBVHgB7L1LkCXHed+bdXreMwAGBAnwiWlQD5MUbUKWQuGwDagZ4QhfrySFN3dHaOGIuxO9undHauWltL0r2hGOkMJhB6mFfcN22BqRCpmWrRBJ8QWIAGYGD+I1wGAe\u002FZrprltf9clz8nzn+zKzeqZ7zun+\u002FRiHVZWVj6+ysgrz\\\\u002FLcCAAAAHHsQsAAAAI4xIlrJ1wO73RcCohUsJvFrhr9PVBYAAMDxBQELAADgmMEUQVhivtf9\u002FnA0Gv1JJ2bdCAAAAHBsQMACAAA4JhBtBUeIG534+i2isgAAAI4PCFgAAABHGIm2kk3n7P8e0VZwFIkLv3\u002F729\u002F+NwEAAACOLAhYAAAAR5DxNMGvdru\u002FF4i2guPBle73b0aj0b8mKgsAAODogYAFAABwhBh\u002FSfAr3e+3A8IVHFMkIovphQAAAEcLBCwAAIAjwFi4+hrTBAGmyPTC7idC1uUAAAAASw0CFgAAwBKDcAVQxZXu93XWyQIAAFheELAAAACWkE63emF3d\u002Fdr3e5qAIBargSELAAAgKUEAQsAAGCJQLgCeCBcCQhZAAAASwUCFgAAwBKAcAVwIFwJCFkAAABLAQIWAADAAoNwBXAoXAkIWQAAAAsNAhYAAMACIouzd8LVNwLCFcBhciUgZAEAACwkCFgAAAALBF8VBFgIroxGo9+93BEAAABgIUDAAgAAWAA63Wq1E62+gXAFsDh0z+O\u002FXllZ+f1Ox7oSAAAA4KGCgAUAAPAQ6YSri7u7u1\u002Fvdn8vAMBCgpAFAADw8FkJAAAA8FB4\u002Fvnnv945xn\u002FU7a4FAFhYmqZ5tntWf\u002Fvpp59url279t0AAAAAhw4RWAAAAIcMC7QDLDVXAgu9AwAAHDoIWAAAAIcE61wBHB2YVggAAHC4IGABAAAcMON1rr4a9ta5uhgA4Cjx+9\u002F+9re\u002FHgAAAOBAQcACAAA4QJguCHAsuNK27Ve\u002F853v\u002FEkAAACAAwEBCwAA4ACQqKvOof2D7vdCAIBjAdMKAQAADg6+QggAAPCAee6552S64De73z8IAHBsiF8rvHTp0o2rV69+PwAAAMADgwgsAACABwSLtANAhGgsAACABwsRWAAAAA+AcdTVH3W\u002FzwUAOPaMo7FeePrpp7euXbv23QAAAAD3BRFYAAAA