RCgAAAM4KAhYAAAC8Nnfv3v2BESZ+yGyG4LBtll\u002Fo7IG9Xu\u002FXiFYAAADwOiBgAQAAwLly7969TyaTyQ+McPEXURR9YjZdEVgGCpfVaDT6xX\u002F5L\u002F\u002FlCwEAAAA4JxCwAAAA4EJRd5bmzFJ3FrmzFgorWN3XnFaPHj16IAAAAAAXBAIWAAAAvFE8QQuH1vxQEawICwQAAIA3CQIWAAAAvFWckEMVtO6YTZ8IvAts57MF\u002FiqO4wdGrPqVAAAAALwlELAAAADgncIIWlfG4\u002FH\u002Fpe4sRK03RiFWqcsKdxUAAAC8ayBgAQAAwDuPK2qZr3eMyPIJ4YdnYjsPA9w26+qs+rVuQ6wCAACAdx0ELAAAAJhbrLBlVq\u002Fkjq1P7Losr7ilYpQVqnQdoQoAAADmHgQsAAAAWEhU3DIfd4zA9VEehnjFEbjSfTJ\u002FIpcKUJpMfdt8bucClYpV271e7wtBpAIAAIAFBQELAAAAlpp\u002F+S\u002F\u002F5UdG\u002FLmj61bososRhq443yUXvlzRy\u002F\u002Fexk6+FN9N\u002Ffb7dl7\u002FjlMu3a\\"\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003EПервый этап разработки миссии для бренда&nbsp;&mdash; создаем скелет\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EЧестно говоря, слово &laquo;разработка&raquo; не&nbsp;совсем применимо, когда речь идет о&nbsp;миссии. Тут уместнее &laquo;осознание&raquo; или &laquo;формулирование&raquo;. Чтобы понять, в&nbsp;чем миссия фирмы и&nbsp;четко изложить&nbsp;ее, необходимо ответить на&nbsp;ряд вопросов. Причем они будут разными для короткой (клиентской) и&nbsp;расширенной (корпоративной) версии.\u003C\u002Fp\u003E\r\n\u003Ctable style=\"width: 100%; border-collapse: collapse; border-style: none;\" border=\"1\"\u003E\r\n\u003Ctbody\u003E\r\n\u003Ctr\u003E\r\n\u003Ctd style=\"width: 50%;\"\u003E\u003Cstrong\u003EВопросы для короткой миссии\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 50%; border-style: none;\"\u003E\u003Cstrong\u003EВопросы для расширенной миссии\u003C\u002Fstrong\u003E\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003Ctr\u003E\r\n\u003Ctd style=\"width: 50%;\"\u003E\r\n\u003Cul\u003E\r\n\u003Cli\u003EЧто мы&nbsp;производим?\u003C\u002Fli\u003E\r\n\u003Cli\u003EДля чего мы&nbsp;это производим?\u003C\u002Fli\u003E\r\n\u003Cli\u003EКто наши покупатели?\u003C\u002Fli\u003E\r\n\u003Cli\u003EДля чего наш товар\u002Fуслуга покупателям?\u003Cbr\u003EКакие &laquo;боли&raquo; ЦА&nbsp;мы&nbsp;закрываем?\u003C\u002Fli\u003E\r\n\u003Cli\u003EЧто сделает нас успешными через 5&nbsp;лет?\u003C\u002Fli\u003E\r\n\u003Cli\u003EКаким путем мы&nbsp;придем к&nbsp;успеху?\u003C\u002Fli\u003E\r\n\u003Cli\u003EЧем мы&nbsp;помогаем обществу и&nbsp;миру?\u003C\u002Fli\u003E\r\n\u003C\u002Ful\u003E\r\n\u003C\u002Ftd\u003E\r\n\u003Ctd style=\"width: 50%; border-style: none;\"\u003E\r\n\u003Cul\u003E\r\n\u003Cli\u003EКакова цель нашей работы?\u003C\u002Fli\u003E\r\n\u003Cli\u003EВ&nbsp;какой области мы&nbsp;работаем?\u003C\u002Fli\u003E\r\n\u003Cli\u003EКакова философия нашего бренда?\u003C\u002Fli\u003E\r\n\u003Cli\u003EКакие методы ведут нас к&nbsp;цели?\u003C\u002Fli\u003E\r\n\u003Cli\u003EКак мы&nbsp;взаимодействуем с&nbsp;ЦА?\u003C\u002Fli\u003E\r\n\u003Cli\u003EЧто мы&nbsp;стремимся показать миру?\u003C\u002Fli\u003E\r\n\u003Cli\u003EНа&nbsp;какой результат мы&nbsp;рассчитываем?\u003C\u002Fli\u003E\r\n\u003Cli\u003EКаким путем мы&nbsp;сможем это сделать?\u003C\u002Fli\u003E\r\n\u003C\u002Ful\u003E\r\n\u003C\u002Ftd\u003E\r\n\u003C\u002Ftr\u003E\r\n\u003C\u002Ftbody\u003E\r\n\u003C\u002Ftable\u003E\r\n\u003Cp\u003EВаша задача состоит в&nbsp;том, чтобы максимально расширить каждый ответ. То&nbsp;есть рассказать &laquo;что мы&nbsp;делаем?&raquo; недостаточно. Также нужно сформулировать &laquo;когда, зачем, какими инструментами?&raquo;. Чем больше вопросов и&nbsp;чем подробнее ответы, тем лучше. Только так можно понять глубинный смысл существования бренда.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAa52SURBVHgB7N0HnKVXeR\u002F+3+293+l9ZnvXrnpdgQQSCCR6tSXHjrFjJ8KOkzixHSDudmwM+Tt2jGPApihUCSGQhMqq1+11ZqfX23uv\u002F+eckRYJJCwBkrb8vrCa3dk79773fc87nzm\\u002F01tv92Jj6ONqwwG3LLyFcMciIiIfoQZREREREREr7PuD7Z3yz+nf0J+u1vCK63dwi3y4VMgIiL6EazAIiIiIiKi14UOrYzYLZOQW9tt+H\u002F07yXHykS\u002FagiAiIj