 скульптор ответил: &laquo;Я&nbsp;беру глыбу мрамора и&nbsp;отсекаю от&nbsp;нее все лишнее&raquo;\u003C\u002Fblockquote\u003E\r\n\u003Cp\u003EТак вот, ваша задача на&nbsp;этом этапе отсечь все лишнее. Оптимальная длина короткой (клиентской) миссии&nbsp;&mdash; 1-3&nbsp;предложения. Расширенная миссия, предназначенная для внутрикорпоративного использования может быть немного длиннее. Но&nbsp;ключевое слово здесь &laquo;немного&raquo;&nbsp;&mdash; 5-7 предложений более чем достаточно.\u003C\u002Fp\u003E\r\n\u003Cp\u003EВнимательно изучите ответы, составляющие скелет миссии. Выделите главную мысль и&nbsp;избавьтесь от&nbsp;всего лишнего и&nbsp;второстепенного. И&nbsp;да! Будьте готовы к&nbsp;тому, что это очень непросто. Именно сокращение ненужного в&nbsp;99,99% случаев становится наиболее сложной задачей.\u003C\u002Fp\u003E\r\n\u003Cp\u003EНесколько примеров миссии бренда:\u003C\u002Fp\u003E\r\n\u003Cul\u003E\r\n\u003Cli\u003E&laquo;Убрать все барьеры между покупателем и&nbsp;продавцом&raquo;&nbsp;&mdash; Alibaba;\u003C\u002Fli\u003E\r\n\u003Cli\u003E&laquo;Изменить к&nbsp;лучшему повседневную жизнь простых людей&raquo;&nbsp;&mdash; IKEA;\u003C\u002Fli\u003E\r\n\u003Cli\u003E&laquo;Чтобы чувствовать себя хорошо&raquo;&nbsp;&mdash; Valio.\u003C\u002Fli\u003E\r\n\u003C\u002Ful\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAkdESURBVHgB7P0JnCV3dd8Nn9rrrr3NPiNpRhJCgAAJY5tFGOQldhxMMF7iJWxe43hB2I4dJ44FfuzkgSw4sRO\u002FdmIEcZ5PHBKDwXiJjRGbjG2QkAAJ7RotM9Mzvd299qr3nPOvurdHYLMJaUb6fUXT3bfvrVv3dtV\\u002Ffqy03R8vy\u002FRKq6Qlx\u002FP+qszs37j44sN3EgAAAPAEAQILAAAAAACA85CqqqwHH374J8oiuS7PkrWqyvk2IttyyHK82HPD\u002F16W5XXHjh1bJwAAAOA8BwILAAAAAACA84yNjY1DszS6vkjibyry1KqoILVX\u002FFGWBVVlThaLLNsOHszt9s8\u002F\u002FamX\u002Fh4BAAAA5zEQWAAAAAAAAJxHPHT69LPyePoHRZYcq6qSb2F5VVbE6orKQr7OWGLlVPHXRZ7zT72I3O4\u002Fm06j\u002F3711VePCQAAADgPgcACAAAAAADgPKCqKvuhU6euTaLJm